import React from "react";
import { styled } from "styled-components";

function Footer() {
  return (
    <FooterContainer>
      <footer style={{ position: "fixed" }}>
        <p>&copy; {new Date().getFullYear()} Stephanie Borchers</p>
      </footer>
    </FooterContainer>
  );
}

export default Footer;

const FooterContainer = styled.div`
  position: fixed;
`;
